import axios from 'axios';
import React, { useState } from 'react';


function ParentUpdate(params) {

    const [formData, setFormData] = useState({
        email: '',
        password: '',
        dob: '',
        gender: '',
        address: '',
        mobileNo: '',
        parentId: '',
        pFirstName: '',
        pLastName: ''
      });

      const handleInputChange = (event) => {
        const { name, value } = event.target;
        setFormData((prevData) => ({
          ...prevData,
          [name]: value
        }));
      };

      const handleSubmit = async (event) => {
        event.preventDefault();

        try {
          const response = await axios.put('YOUR_UPDATE_ENDPOINT', formData);
          console.log('Data updated:', response.data);
          // Perform any further actions, e.g., show success message, navigate back, etc.
        } catch (error) {
          console.error('Error updating data:', error);
        }
      };


    return (
        <div className="container mt-5">
          <h1>Parent Registration Form</h1>
          <form>
            <div className="row">
              <div className="col-md-6">
                <label>Email</label>
                <input type="email" className="form-control" />
              </div>
              <div className="col-md-6">
                <label>Password</label>
                <input type="password" className="form-control" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>Date of Birth</label>
                <input type="date" className="form-control" />
              </div>
              <div className="col-md-6">
                <label>Gender</label>
                <select className="form-control">
                  <option>Male</option>
                  <option>Female</option>
                </select>
              </div>
            </div>
            <div className="row">
              <div className="col-md-12">
                <label>Address</label>
                <textarea className="form-control" rows="3"></textarea>
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>Mobile Number</label>
                <input type="tel" className="form-control" />
              </div>
              <div className="col-md-6">
                <label>Parent ID</label>
                <input type="number" className="form-control" />
              </div>
            </div>
            <div className="row">
              <div className="col-md-6">
                <label>First Name</label>
                <input type="text" className="form-control" />
              </div>
              <div className="col-md-6">
                <label>Last Name</label>
                <input type="text" className="form-control" />
              </div>
            </div>
            <div className="mt-3">
              <button type="submit" className="btn btn-primary">
                Register
              </button>
            </div>
          </form>
        </div>
      );
}



export default ParentUpdate;
